import React from "react";
import AppNav from "./AppNav/AppNav";
import AppLogo from "./AppLogo/AppLogo";

import "./AppHeader.css";

const AppHeader = function (props) {
    return (
        <header>
            <div>
                <Link to="/">EXAM SHOP</Link>
            </div>
            <AppNav />
        </header>
    );
}

export default AppHeader;
